message:
Work on #3856 - Rename string for offline logging

As proposed in #3856.
@rsudev Once uploaded this will reset the existing translations on crowdin ?!

fix #3491: bad encoding in features list

This:
  - forces the use of UTF-8 encoding;
  - escapes HTML characters present in features;
  - closes <p></p> before starting <ul></ul> (as the later cannot be
    embedded in the former according to the HTML specification).

import zipped GPX files (as send by pocket queries)

- accepts zip files named like 123467.zip
- imports cache and waypoint files contained in zip
